import React from 'react';
import { Grommet } from 'grommet';
import AppBar from './AppBar.js';

const theme = {
  global: {
    colors: {
      brand: '#116466',
    },
    font: {
      family: 'Roboto',
      size: '18px',
      height: '20px',
    },
  },
};

function Portfolio() {
	return (
		<Grommet theme={theme} full>
			<AppBar />
			<h1>Hi</h1>
		</Grommet>
	);
}

export default Portfolio;
